const image2 = new Image();
        image2.src = 'data:image/jpeg;base64,';
        
        image2.addEventListener('load', function(){
            const canvas2 = document.getElementById('canvas2');
            const ctx2 = canvas2.getContext('2d');
            canvas2.width = 572;
            canvas2.height = 352;

            let particlesArray2 = [];
            const numberOfParticles2 = 12000;
            const detail2 = 1;

            ctx2.drawImage(image2, 0, 0, canvas2.width, canvas2.height);
            const pixels2 = ctx2.getImageData(0, 0, canvas2.width, canvas2.height);
            ctx2.clearRect(0, 0, canvas2.width, canvas2.height);

            let grid2 = [];
            for (let y2 = 0; y2 < canvas2.height; y2 += detail2) {
                let row2 = [];
                for (let x2 = 0; x2 < canvas2.width; x2 += detail2) {
                    const red2 = pixels2.data[(y2 * 4 * pixels2.width) + (x2 * 4)];
                    const green2 = pixels2.data[(y2 * 4 * pixels2.width) + (x2 * 4 + 1)];
                    const blue2 = pixels2.data[(y2 * 4 * pixels2.width) + (x2 * 4 + 2)];
                    const color2 = 'rgb(' + red2 + ',' + green2 + ',' + blue2 + ')';
                    const brightness2 = calculateBrightness(red2, green2, blue2) / 100;

                    row2.push(brightness2);
                }
                grid2.push(row2);
            }

            class Particle2 {
                constructor() {
                    this.x2 = Math.random() * canvas2.width;
                    this.y2 = 0;
                    this.speed2 = 0;
                    this.velocity2 = Math.random() * 0.7;
                    this.size2 = Math.random() * 2 + 0.1;
                }
                update() {
                    this.speed2 = grid2[Math.floor(this.y2 / detail2)][Math.floor(this.x2 / detail2)];
                    let movement2 = (2.5 - this.speed2) + this.velocity2;
                    this.y2 += movement2;
                    if (this.y2 >= canvas2.height) {
                        this.y2 = 0;
                        this.x2 = Math.random() * canvas2.width;
                    }
                }
                draw() {
                    ctx2.beginPath();
                    ctx2.fillStyle = 'white';
                    ctx2.arc(this.x2, this.y2, this.size2, 0, 2 * Math.PI);
                    ctx2.fill();
                }
            }

            function init2() {
                for (let i = 0; i < numberOfParticles2; i++) {
                    particlesArray2.push(new Particle2());
                }
            }
            init2();

            function animate2() {
                ctx2.globalAlpha = 0.05;
                ctx2.fillStyle = 'rgb(0, 0, 0)';
                ctx2.fillRect(0, 0, canvas2.width, canvas2.height);
                ctx2.globalAlpha = 0.2;
                for (let i = 0; i < particlesArray2.length; i++) {
                    particlesArray2[i].update();
                    ctx2.globalAlpha = particlesArray2[i].speed2 * 0.3;
                    particlesArray2[i].draw();
                }
                requestAnimationFrame(animate2);
            }
            animate2();

            function calculateBrightness(red, green, blue) {
                return Math.sqrt(
                    (red * red) * 0.299 +
                    (green * green) * 0.587 +
                    (blue * blue) * 0.114
                );
            }
        });
        